import React from 'react';
import Layout from './Layout';

function NotFound() {
    return (
        <Layout>
            <div className="container mx-auto mt-8 text-center">
            <img src="/Images/404.png" className="h-8 mr-2" alt="Country Flag" />
            </div>
        </Layout>
    );
}

export default NotFound;
